import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './ImageCarousel.css';

const ImageCarousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
    responsive: [
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
        },
      },
    ],
  };

  return (
    <div className="carousel-container">
      <Slider {...settings}>
        <div className='service'>
          <p>Service A</p>
        </div>
        <div className='service'>
          <p>Service B</p>
        </div>
        <div className='service'>
          <p>Service C</p>
        </div>
        <div className='service'>
          <p>Service D</p>
        </div>
        <div className='service'>
          <p>Service E</p>
        </div>
        <div className='service'>
          <p>Service F</p>
        </div>
        {/* Add more services as needed */}
      </Slider>
    </div>
  );
};

export default ImageCarousel;
